import data from "../../json/painting.json";
console.log(data);

export const Card = () => {
  return (
    <div>
      <img src={data.url} alt={data.title} width="480" />
      <h2>{data.title}</h2>
      <p>
        Author: <a href={data.author.url}>{data.author.tag}</a>
      </p>
      <p>Price: {data.price}</p>
      <p>Quantity: {data.quantity}</p>
      <button>Add</button>
    </div>
  );
};
